INSERT INTO `info kampus` (`id kampus`, `nama kampus`, `image`, `profile`) VALUES
(101, 'UNIVERSITAS LAMPUNG (UNILA)', , 'Terdapat 57 Program Strata Satu (S1) di Kampus Hijau Universitas Lampung (Unila). Seluruhnya tersebar di delapan fakultas, yakni Fakultas Ekonomi dan Bisnis (FEB), Fakultas Ilmu Sosial dan Ilmu Politik (FISIP), Fakultas Hukum (FH), Fakultas Keguruan dan Ilmu Pendidikan (FKIP), Fakultas Matematika dan Ilmu Pengetahuan Alam (FMIPA), Fakultas Pertanian (FP), Fakultas Teknik (FT), dan Fakultas Kedokteran (FK).');
INSERT INTO `info kampus` (`id kampus`, `nama kampus`, `image`, `profile`) VALUES
(102, 'INSTITUT TEKNOLOGI SUMATERA (ITERA)', , 'Institut Teknologi Sumatera (ITERA) adalah sebuah perguruan tinggi negeri yang berkedudukan di antara Kabupaten Lampung Selatan dengan Kota Bandar Lampung. ITERA didirikan berdasarkan Peraturan Presiden Nomor 124 Tahun 2014 tentang Pendirian Institut Teknologi Sumatera (Lembaran Negara Republik Indonesia Tahun 2014 Nomor 253) yang ditetapkan Presiden Republik Indonesia Dr. H. Susilo Bambang Yudhoyono pada tanggal 6 Oktober 2014 dan diundangkan tanggal 9 Oktober 2014. Walaupun peresmiannya dilaksanakan pada tahun 2014, namun ITERA sudah memulai kegiatan akademik dengan menerima mahasiswa baru sejak tahun 2012-2013. Selain ITB dan ITS, dengan dibukanya ITERA dan Institut Teknologi Kalimantan, kini pemerintah Indonesia memiliki empat institut teknologi.');
INSERT INTO `info kampus` (`id kampus`, `nama kampus`, `image`, `profile`) VALUES
(103, 'UIN LAMPUNG', , 'Universitas Islam Negeri Raden Intan Lampung atau yang dulu disebut dengan IAIN Raden Intan Bandar Lampung adalah Perguruan Tinggi Islam Negeri yang berada di kelurahan / kecamatan Sukarame, Bandar Lampung, kota Bandar Lampung provinsi Lampung. ');
INSERT INTO `info kampus` (`id kampus`, `nama kampus`, `image`, `profile`) VALUES
(104, 'POLITEKNIK KESEHATAN TANJUNG KARANG', , 'Politeknik Kesehatan Tanjung Karang adalah universitas negeri Unit Pelaksana Teknis Kemenkes RI dibawah dan bertanggung jawab kepada Kepala Badan Pengembangan dan Pemberdayaan Sumber Daya Manusia Kesehatan yang berada di Kota Bandar Lampung, Provinsi Lampung, Indonesia.');
INSERT INTO `info kampus` (`id kampus`, `nama kampus`, `image`, `profile`) VALUES
(105, 'POLITEKNIK NEGRI LAMPUNG', , 'POLINELA adalah Perguruan Tinggi Negeri di Provinsi Lampung yang menyelenggarakan pendidikan vokasi untuk menciptakan lulusan ahli madya dan sarjana terapan berjiwa disiplin, mandiri dan profesional di Indonesia. ');
INSERT INTO `info kampus` (`id kampus`, `nama kampus`, `image`, `profile`) VALUES
(106, 'UM BANDAR LAMPUNG', , 'Universitas Muhammadiyah Lampung beralamat di: Jl. H. Zainal Abidin Pagar Alam No.14 Kel Labuhan Ratu, Kec Kedaton, Kota Bandar Lampung 35142. Telp /Fax 0721701246 E-mail: humas.umlampung@gmail.com Teknologi informasi membawa perubahan sangat cepat pada berbagai bidang kehidupan manusia.');

